import React from "react";

const Navbar =()=>{
return(
<div className="parent">

<h1>TechShed</h1>

<ul>
<li><link>Home</link></li>
<li>Products</li>
<li>Sales</li>
<li>Contact</li>
</ul>
<button>Log in</button>

</div>
);
}
export default Navbar;
